            <div className="row" >
                <div className="col-12">
                <h4 data-aos="fade-up-right">Our Mission</h4>
                <h3>Enhance The Quality Of Our Farmer Life</h3>
                <p>Al-Asr Group technical field team activities to increase the per acre yield of farmers, value addition in the overall income of farmers.</p>
                <NavLink to="/about"><button>About Us</button></NavLink>

                </div>
            </div>
        </div>

        </section>

    )
}

